import './App.css';

function App() {
  return (
    <div className='w-full ml-sm'>
      <div className='flex items-center justify-center'>
        <div className="m-10 p-12 bg-white broder rounded-lg drop-shadow-lg font-mono">

          <p className=" text-gray-500 p-3 border-b border-color-500"> Airplane	seating	algorithm </p>



        </div>
    </div>
    </div>
  );
}

export default App;
